window.bookSummaryJSON = "<p>One last mission….</p> <p>After a long and exalted military career, General Connor Gates thought he was finally ready to retire. He was wrong.</p> <p>When interstellar probes sent to Earth’s star system report back 40 years earlier than expected, the colonists learn that humans somehow survived the cataclysmic events of the past…but so did the enemy.</p> <p>The colonists owe their lives to the sacrifice made by the people of Earth, but the survivors are struggling and the colonists have the technology to turn the tide. Someone must lead an expeditionary force back to Earth. Connor might have been ready for retirement, but Earth calls, promising answers to what happened so long ago.Can Connor and his friends survive one last mission and pay back the huge debt of sacrifice made long ago?</p> <p><i>Expedition Earth</i> is the 14th book in the best-selling military science fiction series, First Colony. Listen to the 14th book in this sprawling space opera today! Science Fiction for those who long to explore!</p>"; 
